  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This locator tool will help you find
  Title X family planning centers that provide high quality and cost-effective family
  planning and related preventive health services for low-income women and men.</p>n<p>Family
  planning centers offer a broad range of FDA-approved contraceptive methods and related
  counseling; as well as breast and cervical cancer screening; pregnancy testing and
  counseling; screening and treatment for sexually transmitted infections (STIs);
  HIV testing; and other patient education and referrals.</p>n<p>4,400 family planning
  centers serve about 5 million clients each year. Services are provided through state,
  county, and local health departments; community health centers; Planned Parenthood
  centers; and hospital-based, school-based, faith-based, other private nonprofits.</p>n<p>Title
  X staff are specially trained to meet the contraceptive needs of individuals with
  limited English proficiency, teenagers, and those confronting complex medical and
  personal issues such as substance abuse, disability, homelessness or interpersonal
  and domestic violence.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
